export default function App() {

  const [Images, updateImages] = useState([])
  useEffect(() => {
    const apiCall = async () => {
      const Images = await axios(countryUrl)
      console.log(Images)
      console.log(Images.data)
      console.log(Images.data.results)

      updateImages(Images.data)
    }
    apiCall()
  }, [])


  return (
    <div>
      <h1>images</h1>
